import { useEffect, useState } from 'react';
import { Close, CropSquare, HorizontalRule, Logout } from '@mui/icons-material';
import { Avatar, Button, ButtonGroup, IconButton, Menu, MenuItem } from '@mui/material';
import FilterNoneIcon from '@mui/icons-material/FilterNone';
import { Tabs } from '@renderer/layout/components/Tabs';
import { useNavigate } from 'react-router-dom';
import { useAuthStore } from '@renderer/shared/stores';
import { AddressBar } from '@renderer/layout/components/AddressBar';
import { NavigationButtons } from '@renderer/layout/components/NavigationButtons';
import { ZoomButtons } from '@renderer/layout/components/ZoomButtons';
import { SearchBox } from '@renderer/layout/components/SearchBox';
import { useTabsStore } from '@renderer/shared/stores/tabs.store';

export const WindowAction = () => {
  const { isAuth, setUser } = useAuthStore();
  const { resetTab } = useTabsStore();
  const navigate = useNavigate();
  const [isMaximized, setIsMaximized] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);
  useEffect(() => {
    window.electron.ipcRenderer.on('maximize-status-change', (_, status) => setIsMaximized(status));
  }, []);

  const handleMinimize = () => window.electron.ipcRenderer.send('minimize-window');
  const handleMaximize = () => window.electron.ipcRenderer.send('maximize-restore-window');
  const handleClose = () => window.electron.ipcRenderer.send('close-window');
  const handleAvatarClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleMenuClose = () => {
    setAnchorEl(null);
  };
  const handleLogout = () => {
    handleMenuClose();
    localStorage.removeItem('ems_username');
    navigate('/login');
    setUser(null);
    resetTab();
  };

  return (
    <>
      <div className="w-full bg-[#e4e4e4] border-gray-300 flex content-between gap-x-4 drag">
        <Tabs />
        <div className="flex items-center ml-auto no-drag gap-x-2">
          {isAuth && (
            <>
              <IconButton
                onClick={handleAvatarClick}
                sx={{
                  width: 28,
                  height: 28,
                  fontSize: 14,
                  paddingBottom: '10px',
                  '&:hover .MuiAvatar-root': {
                    transform: 'scale(1.05)',
                    transition: 'transform 0.2s ease, box-shadow 0.2s ease',
                  },
                }}
              >
                <Avatar
                  sx={{
                    width: 24,
                    height: 24,
                    fontSize: 14,
                    bgcolor: '#25359D',
                    transition: 'transform 0.2s ease, box-shadow 0.2s ease',
                  }}
                  src="data:image/png;base64,"
                ></Avatar>
              </IconButton>
              <Menu
                anchorEl={anchorEl}
                open={Boolean(anchorEl)}
                onClose={handleMenuClose}
                anchorOrigin={{ vertical: 'bottom', horizontal: 'right' }}
                transformOrigin={{ vertical: 'top', horizontal: 'right' }}
                classes={{
                  list: '!p-0',
                }}
              >
                <MenuItem onClick={handleLogout}>
                  <Logout fontSize="small" className="mr-2" />
                  ng xut
                </MenuItem>
              </Menu>
            </>
          )}
          <ButtonGroup variant={'text'} className={'!rounded-none h-[34px] self-start'}>
            <Button
              title="Thu nh"
              className="hover:bg-gray-300 transition-colors h-full flex items-center justify-center !border-r-0 !rounded-none"
              sx={{ minWidth: 32 }}
              onClick={handleMinimize}
            >
              <HorizontalRule fontSize="small" sx={{ color: '#555' }} />
            </Button>
            <Button
              title={isMaximized ? 'Khi phc' : 'Phng to'}
              className="hover:bg-gray-300 transition-colors h-full flex items-center justify-center !border-r-0 !rounded-none"
              sx={{ minWidth: 32 }}
              onClick={handleMaximize}
            >
              {isMaximized ? (
                <FilterNoneIcon fontSize="small" sx={{ color: '#555' }} />
              ) : (
                <CropSquare fontSize="small" sx={{ color: '#555' }} />
              )}
            </Button>
            <Button
              title="ng"
              className="transition-colors hover:bg-red-500 hover:text-white px-2 py-1 h-full flex items-center justify-center !border-r-0 !rounded-b-none"
              sx={{ minWidth: 32 }}
              onClick={handleClose}
            >
              <Close fontSize="small" sx={{ color: '#555' }} />
            </Button>
          </ButtonGroup>
        </div>
      </div>
      {isAuth && (
        <div className="w-full h-[40px] bg-[#e4e4e4] border-b border-gray-300 flex items-center text-sm text-gray-700">
          <NavigationButtons></NavigationButtons>
          {isAuth && <AddressBar></AddressBar>}
          <div className="flex items-center gap-2 px-4">
            <SearchBox />
            <ZoomButtons />
          </div>
        </div>
      )}
    </>
  );
};
